#
# Build with toolchain groups toolchain
#

tune            = base
ext             = at-sniff_32
output_format   = asc,cfg
teeout          = 1
log_line_width  = 156
iterations      = 1
reportable      = 0
check_md5       = 0
runlist         = all
action          = validate
backup_config   = 0

makeflags       = %{MAKEFLAGS}

default=default=default=default:
CC = %{CC}
CXX = %{CXX}
FC = %{FC}

OPTIMIZE	= -m32 -O3 -fpeel-loops -funroll-loops -ffast-math -fvect-cost-model -mrecip=rsqrt
LDOPT		= -m32 -Wl,-q -Wl,-rpath=%{BASE_DIR}/lib

# This is needed to avoid doing checksum verification of the source files against
# the SPEC MANIFEST file.  The source files contain some changes needed to run with LE
# but until those changes are accepted by SPEC the MANIFEST file will not match.
strict_rundir_verify=0

##########################################
# Integer options
##########################################
400.perlbench=default=default=default:
CPORTABILITY   = -DSPEC_CPU_LINUX_PPC -std=gnu89
EXTRA_CFLAGS = -fno-strict-aliasing

416.gamess=default=default=default:
FPORTABILITY = -std=legacy

462.libquantum=default=default=default:
CPORTABILITY   = -DSPEC_CPU_LINUX

464.h264ref=default=default=default:
CPORTABILITY   = -fsigned-char
EXTRA_CFLAGS   = -fno-aggressive-loop-optimizations

483.xalancbmk=default=default=default:
CXXPORTABILITY   = -DSPEC_CPU_LINUX

##########################################
# Floating point options
##########################################
416.gamess=default=default=default:
EXTRA_FFLAGS = -fno-aggressive-loop-optimizations -funconstrained-commons

433.milc=default=default=default:
EXTRA_CFLAGS = -fno-strict-aliasing

447.dealII=default=default=default:
CXXPORTABILITY = -include cstddef -fpermissive

450.soplex=default=default=default:
CXXPORTABILITY = -std=gnu++98

454.calculix=default=default=default:
EXTRA_LDFLAGS = -Wl,--wrap,atan2 %{LIB32_ATAN2}

481.wrf=default=default=default:
CPORTABILITY = -DSPEC_CPU_CASE_FLAG

482.sphinx3=default=default=default:
CPORTABILITY   = -fsigned-char

